krętu k&oacute;ł. Należy r&oacute;wnież pamiętać aby nie prowadzić w&oacute;zka z nadmierną prędkością zwłaszcza przy podniesionym wysoko ładunku, gdyż może to grozić wypadkiem (przechylenie w&oacute;zka).</p>\r\n<p>Parametry techniczne w&oacute;zka widłowego umieszczone są przez producenta w&oacute;zka na tabliczce znamionowej. Dla bezpieczeństwa, nie powinno się przekraczać dopuszczalnego maksymalnego obciążenia podanego na tabliczce.</p>\r\n<p>Obecnie w&oacute;zki widłowe są bardzo zaawansowanymi maszynami często wyposażonymi w bardzo nowoczesną technologię co jednocześnie powoduje że są dość drogimi pojazdami.</p>','pl','wozek-widlowy'),(4,'Rodzaje wózków widłowych','Wózki widłowe można podzielić na kilka rodzajów w zależności od przyjętego kryterium podziału.','<p>W&oacute;zki widłowe można podzielić na kilka rodzaj&oacute;w w zależności od przyjętego kryterium podziału.</p>\r\n<p>Źr&oacute;dło: Podział w&oacute;zk&oacute;w jezdniowych napędzanych wg polskiej normy \"PN-77/M-78100\"</p>\r\n<p>Najczęściej stosuje się podział w&oacute;zk&oacute;w widłowych ze względu na zastosowane w nich źr&oacute;dło energii. Według tego podziału mamy:</p>\r\n<ul>\r\n<li>w&oacute;zki spalinowe (diesel),</li>\r\n<li>w&oacute;zki gazowe (LPG lub CNG,)</li>\r\n<li>w&oacute;zki elektryczne.</li>\r\n</ul>\r\n<p>Każdy rodzaj w&oacute;zka został stworzony z uwzględnieniem specyficznych warunk&oacute;w do jakich został przeznaczony już w fazie jego projektowania. Dlatego też sugerując się wyborem w&oacute;zka powinniśmy przede wszystkim uwzględniać warunki w jakich będzie on użytkowany. Zamknięte pomieszczenia jak sklepy, hurtownie, magazyny są idealnymi warunkami pracy dla elektrycznych w&oacute;zk&oacute;w widłowych. Elektryczne w&oacute;zki widłowe sprawdzają się rewelacyjnie w środowisku pracy, w kt&oacute;rym powierzchnie pracy dzielą razem z ludźmi. W&oacute;zek elektryczny charakteryzuje się zerowe wydobycie spalin.</p>\r\n<p>W&oacute;zki gazowe są w&oacute;zkami spalinowymi z napędem gazowym. Tak samo jak elektryczne w&oacute;zki widłowe idealnie nadają się do pracy w zamkniętych pomieszczeniach przez wzgląd na mała emisję spalin. Często jednocześnie wykorzystywane są do pracy na otwartych placach. Ich dużą zaletą jest tańsza eksploatacja, większą moc i większy moment obrotowy niż w przypadku widłowego w&oacute;zka elektrycznego.</p>\r\n<p>W&oacute;zek spalinowy z napędem diesla charakteryzuje się mocnym i wydajnym silnikiem a także stosunkowo niską eksploatacją urządzenia. W&oacute;zki z napędem diesla wyłącznie przeznaczone są do użytku na otwartych przestrzeniach.</p>','de','rodzaje-wozkow-widlowych'),(4,'Rodzaje wózków widłowych','Wózki widłowe można podzielić na kilka rodzajów w zależności od przyjętego kryterium podziału.','<p>W&oacute;zki widłowe można podzielić na kilka rodzaj&oacute;w w zależności od przyjętego kryterium podziału.</p>\r\n<p>Źr&oacute;dło: Podział w&oacute;zk&oacute;w jezdniowych napędzanych wg polskiej normy \"PN-77/M-78100\"</p>\r\n<p>Najczęściej stosuje się podział w&oacute;zk&oacute;w widłowych ze względu na zastosowane w nich źr&oacute;dło energii. Według tego podziału mamy:</p>\r\n<ul>\r\n<li>w&oacute;zki spalinowe (diesel),</li>\r\n<li>w&oacute;zki gazowe (LPG lub CNG,)</li>\r\n<li>w&oacute;zki elektryczne.</li>\r\n</ul>\r\n<p>Każdy rodzaj w&oacute;zka został stworzony z uwzględnieniem specyficznych warunk&oacute;w do jakich został przeznaczony już w fazie jego projektowania. Dlatego też sugerując się wyborem w&oacute;zka powinniśmy przede wszystkim uwzględniać warunki w jakich będzie on użytkowany. Zamknięte pomieszczenia jak sklepy, hurtownie, magazyny są idealnymi warunkami pracy dla elektrycznych w&oacute;zk&oacute;w widłowych. Elektryczne w&oacute;zki widłowe sprawdzają się rewelacyjnie w środowisku pracy, w kt&oacute;rym powierzchnie pracy dzielą razem z ludźmi. W&oacute;zek elektryczny charakteryzuje się zerowe wydobycie spalin.</p>\r\n<p>W&oacute;zki gazowe są w&oacute;zkami spalinowymi z napędem gazowym. Tak samo jak elektryczne w&oacute;zki widłowe idealnie nadają się do pracy w zamkniętych pomieszczeniach przez wzgląd na mała emisję spalin. Często jednocześnie wykorzystywane są do pracy na otwartych placach. Ich dużą zaletą jest tańsza eksploatacja, większą moc i większy moment obrotowy niż w przypadku widłowego w&oacute;zka elektrycznego.</p>\r\n<p>W&oacute;zek spalinowy z napędem diesla charakteryzuje się mocnym i wydajnym silnikiem a także stosunkowo niską eksploatacją urządzenia. W&oacute;zki z napędem diesla wyłącznie przeznaczone są do użytku na otwartych przestrzeniach.</p>','pl','rodzaje-wozkow-widlowych'),(5,'Uprawienia na wózki widłowe','Obecnie już w każdym magazynie i w każdej fabryce jest cała flota wózków widłowych wraz z przeszkoloną obsługą, która potrafi sprawnie się nimi poruszać.','<p>W miarę globalizacji, wzrastającego przepływu towar&oacute;w, ciągle wzrastającej liczby magazyn&oacute;w i centr&oacute;w logistycznych &ndash; zapotrzebowania na kierowc&oacute;w operator&oacute;w w&oacute;zk&oacute;w widłowych (w&oacute;zki jezdniowe podnośnikowe) ciągle wzrasta.</p>\r\n<p>Obecnie już w każdym magazynie i w każdej fabryce jest cała flota w&oacute;zk&oacute;w widłowych wraz z przeszkoloną obsługą, kt&oacute;ra potrafi sprawnie się nimi poruszać.<br />W miarę globalizacji, wzrastającego przepływu towar&oacute;w, ciągle wzrastającej liczby magazyn&oacute;w i centr&oacute;w logistycznych &ndash; zapotrzebowania na kierowc&oacute;w operator&oacute;w w&oacute;zk&oacute;w widłowych (w&oacute;zki jezdniowe podnośnikowe) ciągle wzrasta.Można pomyśleć co to za problem prowadzić w&oacute;zek widłowy, przecież taki w&oacute;zek nie rozwija zawrotnych prędkości, wręcz na og&oacute;ł porusza się w ż&oacute;łwim tempie? Nic bardziej złudnego. Prowadzenie w&oacute;zka widłowego wymaga specjalnych uprawnień!<br />Kursy takie organizowane są w wielu ośrodkach doskonalenia zawodowego. Warunkiem uczestniczenia jest ukończenie 18 lat. Celem kursu jest nauka i zdobycie uprawnień do kierowania w&oacute;zkami jezdniowymi. Kurs kończy się egzaminem i wydaniem zaświadczenia uprawniającego do kierowania w&oacute;zkami. Warunkiem podjęcia pracy jest posiadanie zaświadczenia lekarskiego potwierdzającego brak przeciwwskazań do wykonywania zawodu kierowcy w&oacute;zk&oacute;w jezdniowych spalinowych i akumulatorowych.</p>\r\n<p>&nbsp;Aby być operatorem w&oacute;zka widłowego trzeba być odpowiednio przeszkolonym w tym zakresie. Należy mieć skończone 18 lat oraz imienne zezwolenie do obsługi w&oacute;zka wystawione przez pracodawcę (ważne tylko na terenie jego zakładu pracy) lub uzyskać uprawnienia operatora. Uprawnienia na w&oacute;zki widłowe można zdobyć przez <strong>Urząd Dozoru Technicznego</strong>, kt&oacute;ry przeprowadza egzaminy i wydaje uprawnienia ważne na terenie całego kraju, bądź przez <strong>Instytut Mechanizacji Budownictwa i G&oacute;rnictwa Skalnego</strong>, kt&oacute;ry wydaje książkę operatora ważną r&oacute;wnież na terenie całego kraju.</p>','de','uprawienia-na-wozki-widlowe'),(5,'Uprawienia na wózki widłowe','Obecnie już w każdym magazynie i w każdej fabryce jest cała flota wózków widłowych wraz z przeszkoloną obsługą, która potrafi sprawnie się nimi poruszać.','<p>W miarę globalizacji, wzrastającego przepływu towar&oacute;w, ciągle wzrastającej liczby magazyn&oacute;w i centr&oacute;w logistycznych &ndash; zapotrzebowania na kierowc&oacute;w operator&oacute;w w&oacute;zk&oacute;w widłowych (w&oacute;zki jezdniowe podnośnikowe) ciągle wzrasta. </p>\r\n<p>Obecnie już w każdym magazynie i w każdej fabryce jest cała flota w&oacute;zk&oacute;w widłowych wraz z przeszkoloną obsługą, kt&oacute;ra potrafi sprawnie się nimi poruszać.<br />W miarę globalizacji, wzrastającego przepływu towar&oacute;w, ciągle wzrastającej liczby magazyn&oacute;w i centr&oacute;w logistycznych &ndash; zapotrzebowania na kierowc&oacute;w operator&oacute;w w&oacute;zk&oacute;w widłowych (w&oacute;zki jezdniowe podnośnikowe) ciągle wzrasta.Można pomyśleć co to za problem prowadzić w&oacute;zek widłowy, przecież taki w&oacute;zek nie rozwija zawrotnych prędkości, wręcz na og&oacute;ł porusza się w ż&oacute;łwim tempie? Nic bardziej złudnego. Prowadzenie w&oacute;zka widłowego wymaga specjalnych uprawnień!<br />Kursy takie organizowane są w wielu ośrodkach doskonalenia zawodowego. Warunkiem uczestniczenia jest ukończenie 18 lat. Celem kursu jest nauka i zdobycie uprawnień do kierowania w&oacute;zkami jezdniowymi. Kurs kończy się egzaminem i wydaniem zaświadczenia uprawniającego do kierowania w&oacute;zkami. Warunkiem podjęcia pracy jest posiadanie zaświadczenia lekarskiego potwierdzającego brak przeciwwskazań do wykonywania zawodu kierowcy w&oacute;zk&oacute;w jezdniowych spalinowych i akumulatorowych.</p>\r\n<p>&nbsp;Aby być operatorem w&oacute;zka widłowego trzeba być odpowiednio przeszkolonym w tym zakresie. Należy mieć skończone 18 lat oraz imienne zezwolenie do obsługi w&oacute;zka wystawione przez pracodawcę (ważne tylko na terenie jego zakładu pracy) lub uzyskać uprawnienia operatora. Uprawnienia na w&oacute;zki widłowe można zdobyć przez <strong>Urząd Dozoru Technicznego</strong>, kt&oacute;ry przeprowadza egzaminy i wydaje uprawnienia ważne na terenie całego kraju, bądź przez <strong>Instytut Mechanizacji Budownictwa i G&oacute;rnictwa Skalnego</strong>, kt&oacute;ry wydaje książkę operatora ważną r&oacute;wnież na terenie całego kraju.</p>','pl','uprawienia-na-wozki-widlowe'),(6,'Bezpieczeństwo na pierwszym miejscu','9 lutego tego roku, Zdrowie i Bezpieczeństwo Pracy (HSE), odpowienik polskiego BHP, zorganizowała konferencję na temat bezpieczeństwa, na którym zebrali poglądy i opinie ludzi z wszystkich sektorach brytyjskiej gospodarki.','<p>9 lutego tego roku, Zdrowie i Bezpieczeństwo Pracy (HSE), odpowienik polskiego BHP, zorganizowała konferencję na temat bezpieczeństwa, na kt&oacute;rym zebrali poglądy i opinie ludzi z wszystkich sektorach brytyjskiej gospodarki. W jaki spos&oacute;b podnosić świadomość i poprawić bezpieczeństwo ludzi pracujących w otoczeniu w&oacute;zk&oacute;w widłowych. Niestety w polsce takie konferencje to rzadkość i raczej \"boczny tor\" wszelkiego rodzaju targ&oacute;w organizowanych w celu zwiększenia sprzedaży niż raczej poprawie bezpieczeństwa. Sprawdźmy jednak co nasi koledzy z UK ustalają na tego typu sympoziach.<br /><br />Jednym z gł&oacute;wnych powod&oacute;w organizacji konferencji była nagląca potrzeba uświadomienia menedżer&oacute;w i nadzorc&oacute;w jak prawidłowo sprawować nadz&oacute;r, monitorować i zarządzać pracą operator&oacute;w w&oacute;zk&oacute;w widłowych. W Wielkiej Brytanii od 1998 r. (w Polsce - Rozporządzenie Ministra Gospodarki z dn. 30 października 2002 r. w sprawie minimalnych wymagań dotyczących bezpieczeństwa i higieny pracy w zakresie użytkowania maszyn przez pracownik&oacute;w podczas pracy.), wprowadzono normy użytkowania sprzętu podnośnikowego (rozporządzenie PUWER). Norma ta ustanowiła wym&oacute;g prawny dla zarządcy lub nadzorcy odnośnie właściwego zarządzania personelem osobowym. 9 rozporządzenia stanowi:<br /><br />\"Każdy pracodawca zapewnia, że żaden z jego pracownik&oacute;w, kt&oacute;rzy nadzorują lub zarządzać użytkowania sprzętu roboczego otrzymał odpowiednie przeszkolenie w celu ochrony zdrowia i bezpieczeństwa, w tym szkolenia w zakresie metod, kt&oacute;re mogą być przyjęte podczas używania sprzętu roboczego, wszelkiego ryzyka, jakie wykorzystania może pociągać za sobą i środki ostrożności \".<br /><br />Powyższy wym&oacute;g prawny nie oznacza, że menedżerowie i nadzorcy, musą być wykwalifikowanymi podmiotami, ale oznacza to, że powinni przynajmniej być w stanie rozpoznać złe (i dobrze) praktyk i podjęcie niezbędnych krok&oacute;w, aby upewnić się, że miejsce pracy jest bezpieczne dla wszystkich.<br /><br />Jednym z najbardziej skutecznych sposob&oacute;w pracodawc&oacute;w do osiągnięcia tego celu jest to aby ich menedżerowie i nadzorcy odbyli odpowieni kursu podwyższający ich świadomość w zakresie bezpieczeństwa. Taki kurs powinien nauczyć uczestnik&oacute;w podstawowych ram prawnych, a także konkretnie jakie działania powinny być podjęte w celu zwiększenia bezpieczeństwa.</p>','de','bezpieczenstwo-na-pierwszym-miejscu'),(6,'Bezpieczeństwo na pierwszym miejscu','9 lutego tego roku, Zdrowie i Bezpieczeństwo Pracy (HSE), odpowienik polskiego BHP, zorganizowała konferencję na temat bezpieczeństwa, na którym zebrali poglądy i opinie ludzi z wszystkich sektorach brytyjskiej gospodarki.','<p>9 lutego tego roku, Zdrowie i Bezpieczeństwo Pracy (HSE), odpowienik polskiego BHP, zorganizowała konferencję na temat bezpieczeństwa, na kt&oacute;rym zebrali poglądy i opinie ludzi z wszystkich sektorach brytyjskiej gospodarki. W jaki spos&oacute;b podnosić świadomość i poprawić bezpieczeństwo ludzi pracujących w otoczeniu w&oacute;zk&oacute;w widłowych. Niestety w polsce takie konferencje to rzadkość i raczej \"boczny tor\" wszelkiego rodzaju targ&oacute;w organizowanych w celu zwiększenia sprzedaży niż raczej poprawie bezpieczeństwa. Sprawdźmy jednak co nasi koledzy z UK ustalają na tego typu sympoziach.<br /><br />Jednym z gł&oacute;wnych powod&oacute;w organizacji konferencji była nagląca potrzeba uświadomienia menedżer&oacute;w i nadzorc&oacute;w jak prawidłowo sprawować nadz&oacute;r, monitorować i zarządzać pracą operator&oacute;w w&oacute;zk&oacute;w widłowych. W Wielkiej Brytanii od 1998 r. (w Polsce - Rozporządzenie Ministra Gospodarki z dn. 30 października 2002 r. w sprawie minimalnych wymagań dotyczących bezpieczeństwa i higieny pracy w zakresie użytkowania maszyn przez pracownik&oacute;w podczas pracy.), wprowadzono normy użytkowania sprzętu podnośnikowego (rozporządzenie PUWER). Norma ta ustanowiła wym&oacute;g prawny dla zarządcy lub nadzorcy odnośnie właściwego zarządzania personelem osobowym. 9 rozporządzenia stanowi:<br /><br />\"Każdy pracodawca zapewnia, że żaden z jego pracownik&oacute;w, kt&oacute;rzy nadzorują lub zarządzać użytkowania sprzętu roboczego otrzymał odpowiednie przeszkolenie w celu ochrony zdrowia i bezpieczeństwa, w tym szkolenia w zakresie metod, kt&oacute;re mogą być przyjęte podczas używania sprzętu roboczego, wszelkiego ryzyka, jakie wykorzystania może pociągać za sobą i środki ostrożności \".<br /><br />Powyższy wym&oacute;g prawny nie oznacza, że menedżerowie i nadzorcy, musą być wykwalifikowanymi podmiotami, ale oznacza to, że powinni przynajmniej być w stanie rozpoznać złe (i dobrze) praktyk i podjęcie niezbędnych krok&oacute;w, aby upewnić się, że miejsce pracy jest bezpieczne dla wszystkich.<br /><br />Jednym z najbardziej skutecznych sposob&oacute;w pracodawc&oacute;w do osiągnięcia tego celu jest to aby ich menedżerowie i nadzorcy odbyli odpowieni kursu podwyższający ich świadomość w zakresie bezpieczeństwa. Taki kurs powinien nauczyć uczestnik&oacute;w podstawowych ram prawnych, a także konkretnie jakie działania powinny być podjęte w celu zwiększenia bezpieczeństwa.</p>','pl','bezpieczenstwo-na-pierwszym-miejscu'),(7,'Nowy maszt firmy Technologies Lift','Człowiek czasami zastanawia się, dlaczego w naszym rodzimym i pięknym kraju nie ma tak wysoko rozwiniętych firm jak w innych krajach.','\r\n<p>Człowiek czasami zastanawia się, dlaczego w naszym rodzimym i pięknym kraju nie ma tak wysoko rozwiniętych firm jak w innych krajach.</p>\r\n<p>Lift Technologies (USA) uruchomiła właśnie nową linię pięciostopniowych maszt&oacute;w, kt&oacute;ry posiada unikalną kompaktową budowę, dzięki czemu jest w pełni konfigurowalny i zapewnia bardzo dobrą widoczność. Maszt można skonfigurować do wysokości podnoszenia do 331 cm. Cylindry i łańcuchy są zagnieżdżone za szyny masztu kt&oacute;re stanowią czytelne okno widoczności dla operatora podczas wprowadzania i pracy z ładunkiem. Koniec z wiecznym wychylaniem się za ramy w&oacute;zka żeby widzieć gdzie się jedzie lub kładzie ładunek</p>\r\n<p>Nowy maszt może być wyposażony w r&oacute;żne kombinacje wideł i oprzyrządowania dodatkowego typu chwytaki, haki itp.</p>\r\n<p>Korzystając z okazji możemy trochę pom&oacute;wić na łamach portalu o widłach i innych chwytakach do w&oacute;zk&oacute;w widłowych. Obecnie w Unii Europejskiej widły powinny spełniać normę ISO 2330 w zakresie ich wykonania. Og&oacute;lna klasyfikacja wygląda następująco, o szczeg&oacute;łach napiszemy w oddzielnym artykule już wkr&oacute;tce.</p>\r\n<ul>\r\n<li>widły standardowe</li>\r\n<li>widły z zawieszeniem typu PIN</li>\r\n<li>widły powlekane</li>\r\n<li>widły przykręcane</li>\r\n</ul>\r\n<p>Unikalną cechą jest to że maszty te można zastosować do lekkich w&oacute;zk&oacute;w widłowych 1,5T, 2T ładowności.</p>\r\n<p>Lift Technologies jest światowym liderem w projektowaniu, montażu, produkcji i sprzedaży maszt&oacute;w, wagon&oacute;w kolejowych, przesuwnic bocznych.</p>','de','nowy-maszt-firmy-technologies-lift'),(7,'Nowy maszt firmy Technologies Lift','Człowiek czasami zastanawia się, dlaczego w naszym rodzimym i pięknym kraju nie ma tak wysoko rozwiniętych firm jak w innych krajach.','<p>Człowiek czasami zastanawia się, dlaczego w naszym rodzimym i pięknym kraju nie ma tak wysoko rozwiniętych firm jak w innych krajach.</p>\r\n<p>Lift Technologies (USA) uruchomiła właśnie nową linię pięciostopniowych maszt&oacute;w, kt&oacute;ry posiada unikalną kompaktową budowę, dzięki czemu jest w pełni konfigurowalny i zapewnia bardzo dobrą widoczność. Maszt można skonfigurować do wysokości podnoszenia do 331 cm. Cylindry i łańcuchy są zagnieżdżone za szyny masztu kt&oacute;re stanowią czytelne okno widoczności dla operatora podczas wprowadzania i pracy z ładunkiem. Koniec z wiecznym wychylaniem się za ramy w&oacute;zka żeby widzieć gdzie się jedzie lub kładzie ładunek</p>\r\n<p>Nowy maszt może być wyposażony w r&oacute;żne kombinacje wideł i oprzyrządowania dodatkowego typu chwytaki, haki itp.</p>\r\n<p>Korzystając z okazji możemy trochę pom&oacute;wić na łamach portalu o widłach i innych chwytakach do w&oacute;zk&oacute;w widłowych. Obecnie w Unii Europejskiej widły powinny spełniać normę ISO 2330 w zakresie ich wykonania. Og&oacute;lna klasyfikacja wygląda następująco, o szczeg&oacute;łach napiszemy w oddzielnym artykule już wkr&oacute;tce.</p>\r\n<ul>\r\n<li>widły standardowe</li>\r\n<li>widły z zawieszeniem typu PIN</li>\r\n<li>widły powlekane</li>\r\n<li>widły przykręcane</li>\r\n</ul>\r\n<p>Unikalną cechą jest to że maszty te można zastosować do lekkich w&oacute;zk&oacute;w widłowych 1,5T, 2T ładowności.</p>\r\n<p>Lift Technologies jest światowym liderem w projektowaniu, montażu, produkcji i sprzedaży maszt&oacute;w, wagon&oacute;w kolejowych, przesuwnic bocznych.</p>','pl','nowy-maszt-firmy-technologies-lift'),(8,'Opony dla wózków widłowych małe i potężne','Profesjonalne podejście, do sprawy wydawałoby się błahej, jakim jest opona stanowi o profesjonalizmie osoby zarządzającej transportem.','<p><strong>Rodzaje opon</strong></p>\r\n<p><strong>Opona superelastyczna</strong></p>\r\n<p>Opony superelastyczne &ndash; najczęściej jest oponą pełną, najlepiej nadają się do trudnych zadań przed jakimi stają w&oacute;zki widłowe. Są niezwykle odporne na uszkodzenia mechaniczne, na kt&oacute;re są narażone podczas ciężkich prac w hala produkcyjnych jak i w terenie. Dzięki ich stabilności i odporności na duże przeciążenia i przetarcia doskonale nadają się do pracy w trudnym i niejednokrotnie zabrudzonym terenie, w kt&oacute;rym mogą występować resztki gruzu, szkła, metali i innych czynnik&oacute;w mogących w łatwy spos&oacute;b uszkodzić opony. Ponadto posiadają wysoki index nośności oraz charakteryzują się wysoką ekonomicznością. Dzięki tym zaletą są uważane za opony bezobsługowe.</p>\r\n<p><strong>Mogą być montowane:</strong></p>\r\n<p>- na obręczach opon pneumatycznych o mocnej ścianie bocznej</p>\r\n<p>- na feldze standardowej</p>\r\n<p><strong>Występują najczęściej w 2 typach:</strong></p>\r\n<p>- standardowym</p>\r\n<p>- SIT (do montażu bez pierścieni zabezpieczających)</p>\r\n<p>- niebrudząca</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Opona pneumatyczne</strong></p>\r\n<p>Opona pneumatyczna &ndash; jest oponą wypełnioną powietrzem(dla opon bezdętkowych) lub kt&oacute;ra posiada dętkę z powietrzem lub innym gazem. Dzięki wypełnieniu ich powietrzem zachowują dużą elastyczność i zwiększają naturalną amortyzację w&oacute;zka widłowego oraz komfort pracy. Przeznaczone są do w&oacute;zk&oacute;w poruszających się gł&oacute;wnie w halach magazynowych oraz wyboistych i nier&oacute;wnych powierzchniach. Zapewniają duży komfort pracy i stabilizację nawet przy dużych prędkościach. Opona pneumatyczna wymaga okresowych kontroli ciśnienia powietrza lub innego gazu przez co nie jest oponą bezobsługową.</p>\r\n<p><strong>Występują najczęściej w 2 typach:</strong></p>\r\n<p><strong>- </strong>standard</p>\r\n<p><strong>- </strong>niebrudząca ( najczęściej szare, białe, zielone).</p>\r\n<p><strong>Występują w czterech rodzajach:</strong></p>\r\n<p><strong>Opona radialna (promieniowa)</strong></p>\r\n<p>Charakteryzuje się tym, że osnowa ułożona jest pod kątem 90 stopni , czyli promieniowo, radialnie &ndash; stąd jej nazwa. &nbsp;W celu jej wzmocnienia stosuje się specjalne warstwy tzw. opasania. Taki spos&oacute;b ułożenia osnowy sprawia zwiększenie elastyczność boku opony, a specjalne warstwy opasania zwiększają usztywnienie bieżnika, wpływa to na poprawię zachowania się opony podczas zakręt&oacute;w i zwiększa powierzchnię, kt&oacute;rą opona styka się z nawierzchnią.</p>\r\n<p><strong>Zalety:</strong></p>\r\n<p>- precyzyjne prowadzenie (szczeg&oacute;lnie na zakrętach)</p>\r\n<p>- mniejsze zużycie paliwa (większe usztywnienie bieżnika)</p>\r\n<p><strong>Wady:</strong></p>\r\n<p>- obniżona odporność ściany bocznej opony na wszelkiego rodzaju uszkodzenia mechaniczne</p>\r\n<p>- konieczność stosowania tulei metalowo-gumowych w zawieszeniu (większe zużycie zawieszenia, większy koszt eksploatacji zawieszenia)</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Opona diagonalna</strong></p>\r\n<p>Charakteryzuje się tym, że osnowa opony jest zbudowana z kilku warstw specjalnej tkaniny ułożonej na przemian w dw&oacute;ch kierunkach, pod r&oacute;żnym kątem, lecz zawsze mniejszym niż 90 stopni. W zależności od wielkości i obciążenia opony stosuje się r&oacute;żną liczbę warstw tkaniny. Taka budowa opony pozwala na pewną dowolność w stosowaniu opasania, nie wyklucza go ani sztywno nie nakazuje jego stosowania. W przypadku gdy w oponie diagonalnej stosuje się opasanie to taką oponę nazywa się oponą opasaną.</p>\r\n<p><strong>Zalety</strong>:</p>\r\n<p>- podwyższony komfort jazdy, odczuwalny zwłaszcza bezdrożach</p>\r\n<p>- większa odporność ściany bocznej na wszelkiego rodzaju uszkodzenia mechaniczne</p>\r\n<p><strong>Wady</strong>:</p>\r\n<p>- zmniejszona precyzja prowadzenia</p>\r\n<p>- znacznie gorsze zachowanie się opony na zakrętach</p>\r\n<p>- zwiększone zużycie paliwa</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Opony niebrudzące</strong></p>\r\n<p>Są zazwyczaj stosowane w w&oacute;zkach widłowych, kt&oacute;re poruszają się po jasnych podłogach w halach przemysłowych. Opony te stosowane są szczeg&oacute;lnie w przemyśle spożywczym, farmaceutycznym, kosmetycznym i papierniczym. Opony niebrudzące nie pozostawiają ślad&oacute;w na posadzkach magazynowych. Opony niebrudzące dodatkowo nie przewodzą prądu elektrycznego. Spowodowane tym wyładowania elektryczności statycznej w pobliżu niebezpiecznych materiał&oacute;w mogą być przyczyna eksplozji. Dlatego konieczne jest odpowiednie uziemienie pojazdu.</p>\r\n<p><strong>Mogą występować w kilku odcieniach (kolorach) jak i typach:</strong></p>\r\n<p>- opony białe pneumatyczne</p>\r\n<p>- opony szare pneumatyczne</p>\r\n<p>- opony zielone pneumatyczne</p>\r\n<p>- opony białe superelastyczne</p>\r\n<p>- opony szare superelastyczne</p>\r\n<p>- opony zielone superelastyczne</p>\r\n<p>&nbsp;</p>\r\n<table border=\"1\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr style=\"border: none;\">\r\n<td valign=\"top\" width=\"154\">\r\n<p style=\"text-align: center;\"></p>\r\n</td>\r\n<td valign=\"top\" width=\"154\">\r\n<p style=\"text-align: center;\"></p>\r\n</td>\r\n<td valign=\"top\" width=\"154\">\r\n<p style=\"text-align: center;\"></p>\r\n</td>\r\n<td valign=\"top\" width=\"154\">\r\n<p style=\"text-align: center;\"></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign=\"top\" width=\"154\">\r\n<p style=\"text-align: center;\">Opona superelastyczna</p>\r\n</td>\r\n<td valign=\"top\" width=\"154\">\r\n<p style=\"text-align: center;\">Opona SIT</p>\r\n</td>\r\n<td valign=\"top\" width=\"154\">\r\n<p style=\"text-align: center;\">Opona pneumatyczna</p>\r\n</td>\r\n<td valign=\"top\" width=\"154\">\r\n<p style=\"text-align: center;\">Opona niebrudząca</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Producenci</strong></p>\r\n<p>Czas na przegląd producent&oacute;w. Na rynku polskim jak i na innych rynkach świata najbardziej liczący producenci opon to:</p>\r\n<p>- <strong>CONTINENTAL</strong></p>\r\n<p><strong>- AD-TRAK</strong></p>\r\n<p><strong>- ARMOUR</strong></p>\r\n<p><strong>- SOLIDEAL </strong></p>\r\n<p><strong>- TRELLEBORG</strong></p>\r\n<p>W ekonomi i biznesie im większa konkurencja tym lepiej wychodzą na tym klienci, a ściślej m&oacute;wiąc ich portfele. Wyżej wymienieni, jak i inni co roku prześcigają się w technologiach stosowanych do produkcji opon. Należy niezwykle dokładnie prześledzić ofertę gł&oacute;wnych producent&oacute;w. Obecnie każdy z nich w ofercie ma ponad 50 sztuk standardowych typ&oacute;w r&oacute;żniących się budową wewnętrzną oraz rodzajem bieżnika, co roku dodając nowe modele.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Podsumowanie</strong></p>\r\n<p>Mam nadzieje, że przedstawione tutaj informacje pomogą państwu w podjęci dobrej decyzji podczas zakupu opon do swojego widlaka. Niekt&oacute;rzy kierownicy dział&oacute;w logistycznych niezwykle dokładnie analizują &bdquo;rynek oponiarski&rdquo;. Dla firm kt&oacute;re posiadają od kilkadziesiąt pojazd&oacute;w nie koniecznie tylko w&oacute;zk&oacute;w widłowych sprawa odpowiedniego doboru ogumienia może mieć strategiczny wpływ na ekonomię użytkowania pojazd&oacute;w. Profesjonalne podejście, do sprawy wydawałoby się błahej, jakim jest opona stanowi o profesjonalizmie osoby zarządzającej transportem.</p>','de','opony-dla-wozkow-widlowych-male-i-potezne'),(8,'Opony dla wózków widłowych małe i potężne','Profesjonalne podejście, do sprawy wydawałoby się błahej, jakim jest opona stanowi o profesjonalizmie osoby zarządzającej transportem.','<p><strong>Rodzaje opon</strong></p>\r\n<p><strong>Opona superelastyczna</strong></p>\r\n<p>Opony superelastyczne &ndash; najczęściej jest oponą pełną, najlepiej nadają się do trudnych zadań przed jakimi stają w&oacute;zki widłowe. Są niezwykle odporne na uszkodzenia mechaniczne, na kt&oacute;re są narażone podczas ciężkich prac w hala produkcyjnych jak i w terenie. Dzięki ich stabilności i odporności na duże przeciążenia i przetarcia doskonale nadają się do pracy w trudnym i niejednokrotnie zabrudzonym terenie, w kt&oacute;rym mogą występować resztki gruzu, szkła, metali i innych czynnik&oacute;w mogących w łatwy spos&oacute;b uszkodzić opony. Ponadto posiadają wysoki index nośności oraz charakteryzują się wysoką ekonomicznością. Dzięki tym zaletą są uważane za opony bezobsługowe.</p>\r\n<p><strong>Mogą być montowane:</strong></p>\r\n<p>- na obręczach opon pneumatycznych o mocnej ścianie bocznej</p>\r\n<p>- na feldze standardowej</p>\r\n<p><strong>Występują najczęściej w 2 typach:</strong></p>\r\n<p>- standardowym</p>\r\n<p>- SIT (do montażu bez pierścieni zabezpieczających)</p>\r\n<p>- niebrudząca</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Opona pneumatyczne</strong></p>\r\n<p>Opona pneumatyczna &ndash; jest oponą wypełnioną powietrzem(dla opon bezdętkowych) lub kt&oacute;ra posiada dętkę z powietrzem lub innym gazem. Dzięki wypełnieniu ich powietrzem zachowują dużą