INSERT INTO `page_translation` VALUES (1,'Gabelstapler','Bester Gabelstapler','Günstige, gebrauchte Gabelstapler - Toyota, Linde, Jungheinrich','Gabelstapler, jungheinrich, linde, toyota','Schauen Sie sich unser Angebot an und sparen Sie Geld! Sie können günstig kaufen Gabelstapler. Wir Gabelstapler namhaften Unternehmen – Toyota, Linde!','home','de','start'),(1,'Forklifts','The best forklifts on the market','Cheap, used forklifts - Toyota, Linde, Jungheinrich','Forklifts, jungheinrich, linde, toyota','Check out our offer and save money! You can buy cheap used forklift. We offer famous brands forklift – Toyota, Linde!','home','en','start'),(1,'Wózki widłowe','Najlepsze wózki na rynku','Tanie wózki widłowe renomowanych firm | Wozki-com.pl','wózki, widłowe, strzałkowo, tanie, osprzęt, do wózków, widłowych, elektryczne, wózek, widłowy, elektryczny, spalinowe, spalinowy, na gaz, używane, używany, boczny, boczne, jungheinrich, Linde, toyota','Proponujemy tanie wózki widłowe, funkcjonalne i w doskonałym stanie technicznym. Posiadamy wózki takich producentów, jak Linde, Toyota oraz Jungheinrich.','home','pl','start'),(1,'Топ рынка погрузчиков','Топ рынка погрузчиков','Дешево, подъемник - Toyota, Linde, Jungheinrich','грузовики, грузовик, грузовик, грузовики, использовали, использовали, коляски, погрузчики, погрузчик, погрузчик, Jungheinrich, Linde, Toyota','Проверьте наши предложения и сэкономить деньги! Вы можете купить дешевые вилочного погрузчика. Мы погрузчиков авторитетных компаний - Toyota, Linde!','home','ru','start'),(2,'Über uns','Gabelstapler','Gebrauchte Gabelstapler – Strzalkowo','','Wir laden Sie ein, sich mit unserem Angebot vertraut zu machen! Wir bieten Ersatzteile für Gabelstapler und Gabelstapler billig. Strzałkowo ☏ 602 725 994','index','de','Über uns'),(2,'About Us','Forklifts','Used forklifts – Strzałkowo','','We invite you to see our special offers! We offer spare parts for forklifts and forklift cheap. Strzałkowo ☏ 602 725 994','index','en','About Us'),(2,'O nas','Wózki widłowe','Używane wózki widłowe Strzałkowo, osprzęt do wózków | O firmie','','Dostarczamy tanie, używane wózki widłowe. Sprawdź atrakcyjną ofertę i poznaj atuty naszej firmy – zapraszamy!','index','pl','o-nas'),(2,'О нас','Погрузчики','Погрузчик б - Стшалково ( Strzalkowo ) ','','Мы приглашаем Вас ознакомиться с нашим предложением! Мы предлагаем запасные части для погрузчиков и погрузчиков дешево. Стшалково ☏ 602 725 994','index','ru','О нас'),(3,'Angebot Gabelstapler','Gabelstapler','Angebot Gabelstapler','','','index','de','angebot-gabelstapler'),(3,'Offer forklift','Forklift','Offer forklift','','','index','en','offer-forklift'),(3,'Oferta wózków widłowych','Wózki widłowe','Oferta wózków widłowych','','','index','pl','oferta-wozkow-widlowych'),(3,'Предложение погрузчик','Предложение погрузчик','Предложение погрузчик','','','index','ru','Предложение-погрузчик'),(4,'Leasing Gabelstapler','Gabelstapler','Leasing Gabelstapler','Leasing Gabelstapler','Leasing Gabelstapler','index','de','leasing-gabelstapler'),(4,'Leasing forklifts','Forklifts','Leasing forklifts','Leasing forklifts','Leasing forklifts','index','en','leasing-forklifts'),(4,'Leasing wózków widłowych','Wózki widłowe','Leasing wózków widłowych','Leasing wózków widłowych','Leasing wózków widłowych','index','pl','leasing-wozkow-widlowych'),(4,'погрузчик лизинг','погрузчик лизинг','погрузчик лизинг','погрузчик лизинг','погрузчик лизинг','index','ru','погрузчик-лизинг'),(5,'Kontakt','Gabelstapler','Kontakt','Kontakt','Kontakt','index','de','kontakt'),(5,'contact','Forklifts','contact','contact','contact','index','en','contact'),(5,'Kontakt','Wózki widłowe','Kontakt','Kontakt','Kontakt','index','pl','kontakt'),(5,'связаться','грузоподъемник','связаться','связаться','связаться','index','ru','связаться'),(6,'Nachrichten','Gabelstapler','Nachrichten','Nachrichten','Nachrichten','index','de','Nachrichten'),(6,'News','Forklifts','News','News','News','Index','en','News'),(6,'Aktualności','Wózki 