INSERT INTO `product_translation` VALUES (191,'Jungheinrich AM22','',NULL,'de','jungheinrich-am22'),(191,'Jungheinrich AM22','',NULL,'en','jungheinrich-am22'),(191,'Paleciak ręczny Jungheinrich AM22','<ul>\r\n<li>Fabrycznie nowy z gwarancją</li>\r\n<li>Długosć 1150 mm</li>\r\n<li>Szerokość zewnętrzna wideł 520 mm</li>\r\n<li>waga w&oacute;zka 61 kg</li>\r\n<li>K&oacute;łka przy pompie guma</li>\r\n<li>K&oacute;łka na widłach pojedyncze poliuretan</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Paleciak&nbsp; bardzo zwrotny 104 stopnie przy skręcie.</p>\r\n<p>Posiada wygodną rączkę do obsługi przez osoby lewo/prawo ręczne</p>\r\n<p>Specjalnie skonstruowany zaw&oacute;r umożliwia powolne i łagodne opuszczanie palet do 1000kg</p>\r\n<p>Udoskonalony układ hydrauliczny wymaga znacznie mniejszej siły pompowania niż w innych w&oacute;zkach</p>\r\n<p>Wszystkie kola łożyskowane i bezobsługowe</p>\r\n<p>Opr&oacute;cz w&oacute;zk&oacute;w o długości wideł 1150mm mamy wersje -950mm, 800mm oraz poszerzaną wersje wideł 680mm w atrakcyjnych cenach .</p>\r\n<p>Możliwość wysyłki kurierem</p>\r\n<p>&nbsp;</p>',NULL,'pl','paleciak-reczny-jungheinrich-am22'),(191,'Jungheinrich AM22','',NULL,'ru','jungheinrich-am22'),(246,'650-10','',NULL,'de','650-10'),(246,'650-10','',NULL,'en','650-10'),(246,'Opony 650-10','<p>Opony pełne o rozmiarze 650-10 .<br /> Wersja na felgę skręcaną lub pierścieniową .<br /> Stan dobry</p>\r\n<p>Cena za parę</p>\r\n<p><br /> Możliwość przełożenia opon w siedzibie naszej firmy .</p>',350.00,'pl','opony-650-10'),(246,'650-10','',NULL,'ru','650-10'),(250,'Opony 27x10-12','',NULL,'de','opony-27x10-12'),(250,'Opony 27x10-12','',NULL,'en','opony-27x10-12'),(250,'Opony 27x10-12','<p>Opony pełne o rozmiarze 27x10-12 ( białe nie brudzące ) .<br /> Wersja na felgę skręcaną lub pierścieniową .<br /> Stan dobry<br /> <br /> Możliwość przełożenia opon w siedzibie naszej firmy .<br /> Posiadamy prasę hydrauliczną .</p>',1000.00,'pl','opony-27x10-12'),(250,'Opony 27x10-12','',NULL,'ru'