elche Fragen haben,</span> <span class=\"hps\">kontaktieren Sie uns bitte</span> <span class=\"hps\">-</span> <span class=\"hps\">unsere</span> <span class=\"hps\">Berater werden</span> <span class=\"hps\">Ihnen bei der Auswahl</span> <span class=\"hps\">des richtigen Zubeh&ouml;rs</span> <span class=\"hps\">f&uuml;r Ihren</span> <span class=\"hps\">Gabelstapler</span> <span class=\"hps\">helfen.</span></span></p>','de'),(8,'Accessories for forklift  offer','In our large, attractive priced offer includes high quality equipment for forklift trucks. We suggest including grippers, palletizers, turntables and telescopic forks.\r\n\r\nThe right choice of equipment for forklifts determines not only safety, but also comfort. Offered by us accessories come from reliable manufacturers such as AURAMO, Cascade, Kaup if Meyer. It is characterized by not only the durability and strength, but also a significant function.\r\n\r\nWe offer only the best quality equipment for forklift trucks.\r\n\r\nWe encourage you to familiarize yourself with our assortment. If you have any questions, please contact us - our consultants will help you in choosing the right accessories for your forklift trucks.','en'),(8,'Osprzęt oferta','<p>W naszej bogatej, atrakcyjnej cenowo ofercie znajdziecie Państwo najwyższej jakości osprzęt do w&oacute;zk&oacute;w widłowych. Proponujemy między innymi chwytaki, paletyzery, obrotnice oraz widły teleskopowe.</p>\r\n<p>Odpowiedni wyb&oacute;r osprzętu do w&oacute;zk&oacute;w widłowych warunkuje nie tylko bezpieczeństwo, ale r&oacute;wnież komfort pracy. Oferowany przez nas osprzęt pochodzi od sprawdzonych producent&oacute;w takich jak Auramo, Cascade, Kaup czy Meyer. Charakteryzuje się nie tylko trwałością i wytrzymałością, ale także znaczną funkcjonalnością.</p>\r\n<p>Oferujemy Państwu tylko i wyłącznie najlepszej jakości osprzęt do w&oacute;zk&oacute;w widłowych.</p>\r\n<p>Zachęcamy do zapoznania się z naszym asortymentem. W razie jakichkolwiek pytań, zapraszamy do kontaktu &ndash; nasi doradcy pomogą Państwu w wyborze odpowiedniego osprzętu do Waszych w&oacute;zk&oacute;w widłowych.</p>','pl'),(8,'Аксессуары для вилочных погрузчиков предлагают','Аксессуары для вилочных погрузчиков ofertaW нашей богатой и привлекательной цене предложении Вы найдете высокое качество оборудование для вилочных погрузчиков. Мы предлагаем в том числе захваты, паллетизаторов, вертушки и телескопическими вилами.\r\n\r\nПравильный выбор оборудования для погрузчиков определяет не только безопасность, но и комфорт. Предлагаемые нами аксессуары поставляются от надежных производителей, таких как AURAMO, каскад, если Каупа Майер. Он характеризуется не только прочность и долговечность, но и значительную функцию.\r\n\r\nМы предлагаем только лучшее качество оборудование для вилочных погрузчиков.\r\n\r\nМы рекомендуем Вам ознакомиться с нашим ассортиментом. Если у Вас возникли вопросы, пожалуйста, свяжитесь с  Вам в выборе наиболее подходящего аксессуары для вашего погрузчиков.','ru'),(9,'Gebraucht','<p><span id=\"result_box\" class=\"long_text\" lang=\"de\"><span class=\"hps\">Introducing</span> <span class=\"hps\">Sie</span> <span class=\"hps\">eine gro&szlig;e Auswahl an</span> <span class=\"hps\">verschiedenen</span> <span class=\"hps\">Hubwagen,</span> <span class=\"hps\">renommierte</span> <span class=\"hps\">Marken wie</span> <span class=\"hps\">Toyota,</span> <span class=\"hps\">Linde</span><span>, Yale</span> <span class=\"hps\">und</span> <span class=\"hps\">Mitsubishi</span><span>.</span> <span class=\"hps\">Wir</span> <span class=\"hps\">sind</span> <span class=\"hps\">Verbrennungsmotor</span> <span class=\"hps\">Gabelstapler,</span> <span class=\"hps\">Elektro-, Gas</span><span>.</span><br /><br /><span class=\"hps\">Vorgeschlagene</span> <span class=\"hps\">Gabelstapler sind</span> <span class=\"hps\">Unterschiede</span> <span class=\"hps\">in</span> <span class=\"hps\">Bezug auf die</span> <span class=\"hps\">Tonnage</span><span>,</span> <span class=\"hps\">die Menge der</span> <span class=\"hps\">Lift,</span> <span class=\"hps\">run</span> <span class=\"hps atn\">und Typ (</span><span class=\"atn\">side-</span><span>oder</span> <span class=\"hps\">Vorderseite)</span><span>.</span><br /><br /><span class=\"hps\">Wei&szlig;t du nicht,</span> <span class=\"hps\">dass der Lkw</span> <span class=\"hps\">werden</span> <span class=\"hps\">f&uuml;r Sie am geeignetsten</span><span>.</span> <span class=\"hps\">Elektrische</span> <span class=\"hps\">oder</span> <span class=\"hps\">Verbrennung</span><span>?</span> <span class=\"hps\">Side,</span> <span class=\"hps\">und vielleicht die</span> <span class=\"hps\">Front?</span> <span class=\"hps\">F&uuml;hren Sie</span> <span class=\"hps\">uns, um Ihre</span> <span class=\"hps\">Erwartungen und</span> <span class=\"hps\">unsere qualifizierten Mitarbeiter</span> <span class=\"hps\">in</span> <span class=\"hps\">einer</span> <span class=\"hps\">professionellen Art und Weise</span> <span class=\"hps\">wird Ihnen helfen</span><span>, die richtige Wahl</span><span>.</span><br /><br /><span class=\"hps\">Wir laden Sie</span> <span class=\"hps\">ein, sich mit</span> <span class=\"hps\">unserem umfangreichen Angebot</span> <span class=\"hps\">vertraut zu machen.</span></span></p>','de'),(9,'Used','<p>Introducing you a wide selection of various lift trucks, reputed brands such as Toyota, Linde, Yale and Mitsubishi. We include Internal combustion forklifts, electric, gas. Proposed forklifts are differences in terms of tonnage, the amount of lift, run and type (side-or front). Do not you know that the truck will be most suitable for you. Electric or combustion? Side, and maybe the front? Introduce us to your expectations, and our qualified staff in a professional manner will help you make the right choice. We invite you to familiarize yourself with our wide range.</p>','en'),(9,'Używane','<p>Przedstawiamy Państwu wyjątkowo bogaty wyb&oacute;r w&oacute;zk&oacute;w widłowych r&oacute;żnorodnych, renomowanych marek, takich jak Toyota, Linde, Yale czy Mitsubishi. Oferujemy m.in. w&oacute;zki widłowe spalinowe, elektryczne, na gaz.</p>\r\n<p>Proponowane w&oacute;zki widłowe zr&oacute;żnicowanie są pod względem tonażu, wysokości podnoszenia, przebiegu oraz typu (w&oacute;zki boczne lub czołowe).</p>\r\n<p>Nie wiecie Państwo, kt&oacute;ry w&oacute;zek będzie dla Was najodpowiedniejszy. Elektryczny czy spalinowy? Boczny, a może czołowy? Przedstawcie nam swoje oczekiwania, a nasza wykwalifikowana załoga w profesjonalny spos&oacute;b pomoże Państwu dokonać właściwego wyboru.</p>\r\n<p>Zapraszamy do zapoznania się z naszą bogatą ofertą.</p>','pl'),(9,'используемый','<p>Представляем Вам широкий выбор разных погрузчиков, известных брендов, таких как Toyota, Linde, Йельский и Mitsubishi. Мы включаем Внутренняя погрузчиков сгорания, электрические, газовые. Предлагаемые погрузчиков различия с точки зрения тоннажа, количество лифт, Выполнить и введите (побочный или передний). Разве вы не знаете, что грузовик будет наиболее подходящим для вас. Электрическая или сгорания? Сиде, и, возможно, на фронт? Познакомить нас с вашим ожиданиям, и наш квалифицированный персонал на высоком профессиональном уровне поможет вам сделать правильный выбор. Мы приглашаем Вас ознакомиться с нашим широким диапазоном.</p>','ru'),(10,'Wir bieten','<p><span id=\"result_box\" lang=\"de\"><span class=\"hps\">Unser Sortiment umfasst</span> <span class=\"hps\">Gabelstapler</span> <span class=\"hps\">f&uuml;r</span> <span class=\"hps\">Diesel-oder Elektroantrieb</span> <span class=\"hps\">verwendet</span><span>.</span> <span class=\"hps\">Pr&auml;sentiert</span> <span class=\"hps\">Gabelstapler</span> <span class=\"hps\">sind vielf&auml;ltig</span> <span class=\"hps\">in</span> <span class=\"hps\">Bezug auf Kapazit&auml;t</span><span>, Hubh&ouml;he</span> <span class=\"hps\">und Funktion.</span> <span class=\"hps\">Wir haben ein professionelles</span> <span class=\"hps\">Personal, das</span> <span class=\"hps\">gerne alle</span> <span class=\"hps\">Fragen zu</span> <span class=\"hps\">den technischen Spezifikationen</span> <span class=\"hps\">beantworten.</span> <span class=\"hps\">Wir freuen uns</span> <span class=\"hps\">auch auf</span> <span class=\"hps\">Jungheinrich</span> <span class=\"hps\">Gabelstapler</span> <span class=\"hps\">Marke</span> <span class=\"hps\">Toyota,</span> <span class=\"hps\">Linde</span><span>, Mitsubishi</span> <span class=\"hps\">und</span> <span class=\"hps\">andere verwenden</span><span>.</span><br /><br /><span class=\"hps\">Kaufen Sie billig</span> <span class=\"hps\">Gabelstapler,</span> <span class=\"hps\">k&ouml;nnen Sie sicher sein</span><span>, dass die Arbeit</span> <span class=\"hps\">im Unternehmen</span> <span class=\"hps\">wird effizienter</span> <span class=\"hps\">und effektiver</span> <span class=\"hps\">werden.</span> <span class=\"hps\">Gebrauchte Gabelstapler</span><span>, sparen</span> <span class=\"hps\">nicht nur</span> <span class=\"hps\">Zeit, sondern auch</span> <span class=\"hps\">Geld, das auf</span> <span class=\"hps\">irgendeinem</span> <span class=\"hps\">Investitionsbedarf</span> <span class=\"hps\">ausgegeben werden kann</span><span>.</span><br /><br /><span class=\"hps\">Unser Leistungsspektrum</span> <span class=\"hps\">umfasst nicht nur</span> <span class=\"hps\">Umsatz, sondern auch</span> <span class=\"hps\">die</span> <span class=\"hps\">M&ouml;glichkeit des Leasings</span> <span class=\"hps\">Gabelstaplern.</span> <span class=\"hps\">Sie sind willkommen,</span> <span class=\"hps\">mit unserem Angebot</span> <span class=\"hps\">vertraut zu machen.</span></span></p>','de'),(10,'We offer','<p>Our range includes forklift trucks used for diesel or electric drive. Presented forklifts are diverse in terms of capacity, lifting height and function. We have a professional staff who will be happy to answer any questions about the technical specifications. We are happy also to operate a forklift Jungheinrich, Toyota, Linde, Mitsubishi and others. Buying cheap forklift trucks, you can be assured that the work in the enterprise will become more efficient and more effective. Used forklift trucks will save not only time but also money that can be spent on any investment needs. Our range of services includes not only sales, but also the possibility of leasing forklifts. We invite you to familiarize yourself with our offer.</p>','en'),(10,'','<div class=\"tsart\">\r\n<h2>Witamy na naszej stronie internetowej</h2>\r\n<p>Specjalnością naszej firmy jest sprzedaż oraz leasing w&oacute;zk&oacute;w widłowych. Dostarczamy naszym Klientom w&oacute;zki widłowe używane - spalinowe, elektryczne oraz na gaz, a także sprawdzony i niezawodny osprzęt do w&oacute;zk&oacute;w widłowych. Posiadamy m.in. chwytaki, widły teleskopowe, obrotnice oraz paletyzery. W asortymencie posiadamy w&oacute;zki widłowe sprawdzonych i doskonale znanych na rynku producent&oacute;w, takich jak między innymi Toyota, Linde oraz Jungheinrich.</p>\r\n<h3 style=\"font-size: 18px; margin-bottom: 8px; text-align: justify;\">Oferujemy tanie w&oacute;zki widłowe, używane pojazdy specjalistyczne, kt&oacute;re pozwolą usprawnić pracę w przedsiębiorstwie.</h3>\r\n<p>Oferujemy tanie w&oacute;zki widłowe, używane pojazdy specjalistyczne, kt&oacute;re pozwolą usprawnić pracę w przedsiębiorstwie. Każdy oferowany przez nas w&oacute;zek widłowy Toyota, Linde czy Jungheinrich stanowi gwarancję niezawodności, pomagając w udoskonaleniu wszelkiego rodzaju prac przeładunkowych i transportowych.</p>\r\n<p>Przygotowana przez nas oferta będzie doskonałą propozycją dla wszystkich os&oacute;b, kt&oacute;re pragną nabyć solidne oraz niezawodne w&oacute;zki widłowe boczne lub czołowe, pochodzące od znanych i cenionych producent&oacute;w. W&oacute;zek widłowy Jungheinrich, Toyota, Linde lub Mitsubishi to zaledwie jedne z wielu przykładowych marek, kt&oacute;re jesteśmy w stanie zaoferować naszym Klientom. Wszystkie tanie w&oacute;zki widłowe cechują się pełną funkcjonalnością, znajdując zastosowanie zar&oacute;wno w zamkniętych obiektach, jak i w na otwartych przestrzeniach.</p>\r\n<p>Decydując się na nabycie taniego w&oacute;zka widłowego za pośrednictwem naszej firmy, możecie Państwo rozliczyć jego zakup takimi materiałami, jak: styropian ociepleniowy, kostka brukowa, stal, płyty budowlane, pustaki, ogrodzenie, płytki elewacyjne, pokrycia dachowe, bramy, drzwi, okna oraz wieloma innymi.</p>\r\n<p>W&oacute;zek widłowy elektryczny, na gaz lub spalinowy. W&oacute;zek widłowy boczny bądź czołowy. Dysponujemy wieloma rozwiązaniami technologicznymi. Zr&oacute;żnicowanie pod względem udźwigu, wysokości podnoszenia oraz posiadanych funkcji sprawi, że każdy inwestor odnajdzie w naszej ofercie w&oacute;zek widłowy używany na miarę swoich potrzeb.</p>\r\n<p>Jeśli zaprezentowana przez nas oferta wzbudzi Państwa zainteresowanie, serdecznie zachęcamy do skontaktowania się z naszą firmą. Odpowiemy na wszelkie pytania dotyczące specyfikacji technicznej, a także przedstawimy zalety, kt&oacute;rymi wyr&oacute;żniają się poszczeg&oacute;lne w&oacute;zki widłowe. Strzałkowo, Babin Olędry 10 &ndash; zapraszamy! Numery telefon&oacute;w oraz adres mailowy znajdują się w dolnej sekcji strony internetowej lub w zakładce KONTAKT.</p>\r\n</div>','pl'),(10,'Мы предлагаем','<p>Наш ассортимент включает вилочные погрузчики используются для дизельным или электрическим приводом. Представлены погрузчики разнообразны по мощности, высоте подъема и функции. У нас есть профессиональный персонал, который будет рад ответить на любые вопросы о технических характеристиках. Мы рады также использовать погрузчик Jungheinrich бренда, Toyota, Linde, Mitsubishi и другие. Покупка дешевых погрузчиков, вы можете быть уверены, что работа на предприятии станет более эффективным и более эффективным. Подержанные вилочные автопогрузчики Yale будет экономить не только время, но и деньги, которые можно потратить на любые инвестиционные потребности. В спектр наших услуг входит не только продаж, но и возможность аренды вилочных погрузчиков. Мы приглашаем Вас ознакомиться с нашим предложением.</p>','ru'),(11,'Box 1','<p><a title=\"\" href=\"mailto:wozkistrzalkowo@gmail.com\">wozkistrzalkowo@gmail.com</a><br />+48 602 725 994<br />+48 666 843 578</p>','de'),(11,'Box 1','<p>wozkistrzalkowo@gmail.com +48 602 725 994 +48 666 843 578</p>','en'),(11,'Box 1','<p><a title=\"\" href=\"mailto:wozkistrzalkowo@gmail.com\">wozkistrzalkowo@gmail.com</a><br /> +48 602 725 994<br /> +48 666 843 578</p>','pl'),(11,'Box 1','<p>wozkistrzalkowo@gmail.com +48 602 725 994 +48 666 843 578</p>','ru'),(12,'Box 2','<p>Henryka Węgrzeniejewska<br /> 62-420 Strzałkowo<br /> ul. Słowackiego 15</p>','de'),(12,'Box 2','<p>Henryka Węgrzeniejewska<br /> 62-420 Strzałkowo<br /> ul. Słowackiego 15</p>','en'),(12,'Box 2','<p>Henryka Węgrzeniejewska<br /> 62-420 Strzałkowo<br /> ul. Słowackiego 15</p>','pl'),(12,'Box 2','<p>Henryka Węgrzeniejewska<br /> 62-420 Strzałkowo<br /> ul. Słowackiego 15</p>','ru'),(13,'Box 3','<p>NIP PL 667-112-46-37<br /> REGON 311554870</p>','de'),(13,'Box 3','NIP PL 667-112-46-37<br>\r\n            REGON 311554870','en'),(13,'Box 3','<p>NIP PL 667-112-46-37<br /> REGON 311554870</p>','pl'),(13,'Box 3','NIP PL 667-112-46-37<br>\r\n            REGON 311554870','ru'),(14,' Galerie','<p><span id=\"result_box\" class=\"short_text\" lang=\"de\"><span class=\"hps\">Wir empfehlen Ihnen,</span> <span class=\"hps\">unsere Fotogalerie</span> <span class=\"hps\">zu sehen</span><span>.</span></span></p>','de'),(14,'Gallery','<p><span id=\"result_box\" lang=\"en\"><span class=\"hps\">We encourage you</span> <span class=\"hps alt-edited\">to see</span> <span class=\"hps\">our</span> <span class=\"hps\">photo gallery</span><span>.</span></span></p>','en'),(14,'Galeria','<p>Serdecznie zachęcamy do zapoznania się z naszą galerią zdjęć.</p>','pl'),(14,'галерея','<p><span id=\"result_box\" lang=\"ru\"><span class=\"hps\">Мы рекомендуем Вам</span> <span class=\"hps\">ознакомиться с</span> <span class=\"hps\">нашей фотогалерее</span><span>.</span></span></p>','ru'),(15,'.','<p>.</p>','de'),(15,'.','<p>.</p>','en'),(15,'Profesjonalne części do wózków widłowych | Wozki-com.pl','<p>H1: Pełna gama części do w&oacute;zk&oacute;w widłowych Tylko wysokiej jakości części do w&oacute;zk&oacute;w widłowych sprawiają, że praca przy pomocy tych pojazd&oacute;w transportowych może być komfortowa i bezpieczna. Jesteśmy dostawcami profesjonalnych rozwiązań w zakresie przewozu ładunk&oacute;w i oferujemy wyłącznie markowe części zamiennych do w&oacute;zk&oacute;w widłowych. Oferowane przez nas części do w&oacute;zk&oacute;w widłowych to szeroki wyb&oacute;r akcesori&oacute;w zwiększających bezpieczeństwo pracy, a także ułatwiających transport i rozładunek. Dokładamy wszelkich starań, by wysoką jakością mogły poszczycić się wszystkie nasze. W&oacute;zki widłowe to pojazdy, kt&oacute;re dają wiele możliwości, więc w zależności od potrzeb można doposażyć je nie tylko w widły czy stabilizatory ładunku. W asortymencie posiadamy części zamienne do w&oacute;zk&oacute;w widłowych takich producent&oacute;w, jak: Linde, Jungheinrich, Kaup, Stabau oraz Meyer. Nie ma większego znaczenia, czy posiadają Państwo niemieckie czy japońskie wozki widlowe. Czesci, kt&oacute;re posiadamy można bez trudu dopasować praktycznie do każdego modelu w&oacute;zka. H2: W&oacute;zki widłowe &ndash; części ułatwiające prace rozładunkowe Prawidłowo dobrane części do w&oacute;zk&oacute;w widłowych mogą w dużej mierze ułatwiać prace rozładunkowe oraz przeładunkowe w magazynach i halach. Poza takimi częściami do w&oacute;zk&oacute;w widłowych, jak koła, rolki masztu, widły oraz opony, posiadamy w ofercie r&oacute;wnież rozruszniki i przełączniki, kt&oacute;re szczeg&oacute;lnie ważne są w przypadku elektrycznych w&oacute;zk&oacute;w widłowych. Części dobrze dobrane zwiększają bezpieczeństwo pracy, sprawiając jednocześnie, że w&oacute;zki widłowe stają się niezastąpionymi urządzeniami w branży logistycznej. Warto podkreślić, że poza wyżej wymienionymi częściami zamiennymi do w&oacute;zk&oacute;w widłowych, duże znaczenie mają także takie elementy, jak hamulce i przewody hamulcowe. Doskonale wiemy, że od właściwie dobranych element&oacute;w często zależy funkcjonalność, jaką wykazują w&oacute;zki widłowe. Części zamienne, kt&oacute;re posiadamy w ofercie pochodzą od znanych i sprawdzonych dostawc&oacute;w, gwarantując wysoką sprawność. Oferujemy między innymi części zamienne do w&oacute;zk&oacute;w widłowych Toyota i Mitsubishi.</p>','pl'),(15,'.','<p>.</p>','ru');
